import {giftFactory} from './gift.js'
export class GiftsFactory {
    constructor() {
        this.dwarf = new Dwarf();
        this.sled = new Sled();
    }

    getDwarf() {
        return this.dwarf
    }

    getSled() {
        return this.sled
    }
}
